import React from 'react';

function SummaryDisplay({ cleanedTranscriptions }) {
  return (
    <div className="summary-display">
      <h2>Cleaned Transcription Summary</h2>
      {(!cleanedTranscriptions || cleanedTranscriptions.length === 0) ? (
        <p style={{ color: '#888', fontStyle: 'italic' }}>
          No cleaned transcriptions available.
        </p>
      ) : (
        <ul style={{ paddingLeft: 20 }}>
          {cleanedTranscriptions.map((text, idx) => (
            <li key={idx} style={{ marginBottom: 8 }}>{text}</li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default SummaryDisplay;
